import React from 'react';
import './App.css';
import Navbar from './components/navbar/navbar';
import { BrowseRouter,Routes,Route} from 'react-router-dom';
import Shop from './Pages/Shop'


function App() {
  return (
    <div >
      <BrowseRouter>
      <Navbar/>
      <Routes>
        <Route path='/'element={<Shop/>}/>

      </Routes>
      </BrowseRouter>
     <hr/>
          </div>
  )
}

export default App;
